import "./App.css";
import AppNavbar from "./component/AppNavbar";
import { Route, Routes } from "reacr-router-dom";
import Products from "./component/Products";
function App() {
  return (
    <div className="App">
      <AppNavbar />
      <Route path="/" element={<Products />}></Route>
      <Route path="/cart" element={<Cart />}></Route>
    </div>
  );
}

export default App;
